import Vue from 'vue'
import VueRouter from 'vue-router'
import Tabletop from './views/Table'
import SensorDetail from './views/SensorDetail'
import MetricList from './views/MetricList'
Vue.use(VueRouter)

export default new VueRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes: [
        {
            path: '/api/table',
            name: 'Tabletop',
            component: Tabletop
        },
        {
            path: '/api/sensors/:id/',
            name: 'SensorDetail',
            component: SensorDetail
        },
        {
            path: '/api/metricslist/',
            name: 'MetricList',
            component: MetricList
        },
    ]
})
